&quot;The Real Adventures of Jonny Quest is an animated action-adventure television series produced by Hanna-Barbera Cartoons and broadcast on Cartoon Network from August 26, 1996 to April 16, 1997. A revival of the Jonny Quest franchise, it featured Jonny and Hadji as teenage protagonists with a new character, Race Bannon's daughter, Jessie. Creators staged the show around Dr. Quest's investigations of &quot;existing, real phenomena&quot; and mysteries in exotic locales, which brought him into conflict with ethically-differing villains. Action also took place in the virtual realm of QuestWorld, a 3D cyberspace domain rendered with computer animation.&quot;
